import React from "react";
import Card from './Cards';
import './index.css';

function App(){
    return (
        <>
            <h1 className="heading_style">Netflix movies</h1>
            <Card

                imgsrc="https://wallpapercave.com/wp/wp4056410.jpg"
                title="Dark"
                link="https://www.netflix.com/search?q=dark&jbv=80100172"

            />
            <Card

                imgsrc="https://wallpapercave.com/w/wp7418550.jpg"
                title="Extracircular"
                link="https://www.netflix.com/search?q=encounter&jbv=81482494"
            />
            <Card

                imgsrc="https://wallpapercave.com/w/wp1839578.jpg"
                title="Stranger Things"
                link="https://www.netflix.com/search?q=stran&jbv=80057281"
            />
        </>
    )
}

export default App;
